import './styles/App.css';
import ExampleComponent from './components/ExampleComponent';
import Chat from './chat.jsx';
function App() {
    return (
        <div className="container-fluid vh-100">
            <div className="row h-100">
                <div className="col-4 bg-light">

                </div>
                <div className="col-8">
                    <Chat />
                </div>
            </div>
        </div>
    );
}

export default App;
